import json

variableFieldDict = inputs['VariableFieldObject']
variablesInput = inputs['Variables']
inputVar = inputs['InputVar']

variables = []
for var in variables:
	try:
		definition = var['qDefinition']
	except Exception:
		definition = None

	var['qDefinition'] = definition
	variables.append(var)

variableDict = {}
for var in variables:
	variableDict[var['qName']] = var['qDefinition']


def processVar(inputVar, originVar, variableDict, variableFieldDict, output=[]):
    matchInfo = variableFieldDict[inputVar]
    matchList = matchInfo['FieldMatches']
    if variableFieldDict[inputVar]['VariableId'] != variableFieldDict[originVar]['VariableId']:
        if len(matchList) >= 1:
            for field in matchList:
                output.append({
                    "FieldName": field['FieldName'],
                    "FieldMatchStrength": field['FieldMatchStrength'],
                    "MatchVariableId": variableFieldDict[inputVar]['VariableId'],
                    "MatchVariableName": inputVar,
					"MatchVariableExpression": [var['qDefinition'] for var in variables if var['qName'] == inputVar][0],
                    "VariableId": variableFieldDict[originVar]['VariableId'],
                    "VariableName": originVar,
                    "VariableExpression": [var['qDefinition'] for var in variables if var['qName'] == originVar][0],
                })
        else:
            output.append({
                "FieldName": None,
                "FieldMatchStrength": None,
                "MatchVariableId": variableFieldDict[inputVar]['VariableId'],
                "MatchVariableName": inputVar,
                "MatchVariableExpression": [var['qDefinition'] for var in variables if var['qName'] == inputVar][0],
                "VariableId": variableFieldDict[originVar]['VariableId'],
                "VariableName": originVar,
                "VariableExpression": [var['qDefinition'] for var in variables if var['qName'] == originVar][0],
            })
    for otherVar in variableDict:
        if inputVar != otherVar:
            if otherVar in variableDict[inputVar]:
                processVar(otherVar, originVar,
                           variableDict, variableFieldDict)
    return output


output = processVar(inputVar, inputVar, variableDict, variableFieldDict)

print(json.dumps(output))
